import logo from './logo.svg';
import './App.css';
import Header from './hero/Header';

function App() {
  return (
    <div className="App">
      <div className="sidebar">
        <h2>Sidebar</h2>
      </div>
      <div className="hero">
        <Header/>
      </div>
    </div>
  );
}

export default App;
